import React from 'react';
import '../App.css';

const PersonCard = props => {
    return (
        <div className = "cardLayout">
            <div className = "personInfoSection">
                <h1>sasd</h1>
            </div>
            <div className = "locationInfoSection">
                <div className = "leftColumnLayout">
                    <i className = "fa fa-map-marker" style = {styles.cardIconLayout}/>
                </div>
                <div className = "rightColumnLayout">
                    <h5>{props.person.address.street}</h5>
                    <h5>{props.person.address.suite}</h5>
                    <h5>{props.person.address.city}</h5>
                    <h5>{props.person.address.zipcode}</h5>
                    <h5>{props.name}</h5>
                    <h5>{props.name}</h5>
                    <h5>{props.name}</h5>
                </div>
            </div>
            <div className = "callSection">
                <div className = "callButton">
                    <h3>Call</h3>
                </div>
            </div>
        </div>
    );
}

let styles = {
    cardIconLayout: {
        fontSize: 25
    }
}

export default PersonCard;
